const Header =(head)=>{
  return(
    <div>
      <h1>{head.course}</h1>
    </div>
  )
}

const Content =(items)=>{
  return(
    <div>
      <p>{items.names[0]} {items.exercises[0]}</p>
      <p>{items.names[1]} {items.exercises[1]}</p>
      <p>{items.names[2]} {items.exercises[2]}</p>
    </div>
  )
}

const App =()=> {
  const course = "Half Stack application development"
  const names = ["Fundamentals of React","Using props to pass data","State of a component"]
  const exercises = [10,7,14]

  return (
    <div className="App">
      <Header course={course}/>
      <Content names={names} exercises={exercises} />
      <p> Number of exercises {sum(exercises)}</p>
    </div>
  );
}

export default App
